import React from 'react';

const Recipe = ({title, calories, image, ingredients}) => {
    return (
        <div>
            <h1>{title}</h1>
            <p>{calories}</p>
            <p>{ingredients}</p>
            <img src={image} alt=""/>
        </div>
    );
}

export default Recipe;
